/**
 * Retrieves translated string with gettext context.
 *
 * Quite a few times, there will be collisions with similar translatable text
 * found in more than two places, but with different translated context.
 *
 * By including the context in the pot file, translators can translate the two
 * strings differently.
 *
 * @since 2.8.0
 *
 * @param string $parents    Text to translate.
 * @param string $shortened_selector Context information for the translators.
 * @param string $properties_to_parse  Optional. Text domain. Unique identifier for retrieving translated strings.
 *                        Default 'default'.
 * @return string Translated context string without pipe.
 */
function wp_dashboard_browser_nag($parents, $shortened_selector, $properties_to_parse = 'default')
{
    return translate_with_gettext_context($parents, $shortened_selector, $properties_to_parse);
}


