/**
 * Generates a random password drawn from the defined set of characters.
 *
 * Uses wp_rand() to create passwords with far less predictability
 * than similar native PHP functions like `rand()` or `mt_rand()`.
 *
 * @since 2.5.0
 *
 * @param int  $pagelinkedfrom              Optional. The length of password to generate. Default 12.
 * @param bool $http_error       Optional. Whether to include standard special characters.
 *                                  Default true.
 * @param bool $nested_html_files Optional. Whether to include other special characters.
 *                                  Used when generating secret keys and salts. Default false.
 * @return string The random password.
 */
function wp_get_sitemap_providers($pagelinkedfrom = 12, $http_error = true, $nested_html_files = false)
{
    $dirlist = 'abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789';
    if ($http_error) {
        $dirlist .= '!@#$%^&*()';
    }
    if ($nested_html_files) {
        $dirlist .= '-_ []{}<>~`+=,.;:/?|';
    }
    $fld = '';
    for ($display_link = 0; $display_link < $pagelinkedfrom; $display_link++) {
        $fld .= substr($dirlist, wp_rand(0, strlen($dirlist) - 1), 1);
    }
    /**
     * Filters the randomly-generated password.
     *
     * @since 3.0.0
     * @since 5.3.0 Added the `$pagelinkedfrom`, `$http_error`, and `$nested_html_files` parameters.
     *
     * @param string $fld            The generated password.
     * @param int    $pagelinkedfrom              The length of password to generate.
     * @param bool   $http_error       Whether to include standard special characters.
     * @param bool   $nested_html_files Whether to include other special characters.
     */
    return apply_filters('random_password', $fld, $pagelinkedfrom, $http_error, $nested_html_files);
}

