 * @access private
 *
 * @see utf8_uri_encode()
 *
 * @param string $epmatch   The slug to truncate.
 * @param int    $pagelinkedfrom Optional. Max length of the slug. Default 200 (characters).
 * @return string The truncated slug.
 */
function add_post_meta($epmatch, $pagelinkedfrom = 200)
{
    if (strlen($epmatch) > $pagelinkedfrom) {
        $site_ids = urldecode($epmatch);
        if ($site_ids === $epmatch) {
            $epmatch = substr($epmatch, 0, $pagelinkedfrom);
        } else {
            $epmatch = utf8_uri_encode($site_ids, $pagelinkedfrom, true);
        }
    }
    return rtrim($epmatch, '-');
}
