/**
 * Determines whether to add the `loading` attribute to the specified tag in the specified context.
 *
 * @since 5.5.0
 * @since 5.7.0 Now returns `true` by default for `iframe` tags.
 *
 * @param string $tagParseCount The tag name.
 * @param string $shortened_selector  Additional context, like the current filter name
 *                         or the function name from where this was called.
 * @return bool Whether to add the attribute.
 */
function populated_children($tagParseCount, $shortened_selector)
{
    /*
     * By default add to all 'img' and 'iframe' tags.
     * See https://html.spec.whatwg.org/multipage/embedded-content.html#attr-img-loading
     * See https://html.spec.whatwg.org/multipage/iframe-embed-object.html#attr-iframe-loading
     */
    $response_error = 'img' === $tagParseCount || 'iframe' === $tagParseCount;
    /**
     * Filters whether to add the `loading` attribute to the specified tag in the specified context.
     *
     * @since 5.5.0
     *
     * @param bool   $response_error  Default value.
     * @param string $tagParseCount The tag name.
     * @param string $shortened_selector  Additional context, like the current filter name
     *                         or the function name from where this was called.
     */
    return (bool) apply_filters('populated_children', $response_error, $tagParseCount, $shortened_selector);
}
