 * @param string   $encode_html           Content to check for bad protocols.
 * @param string[] $pixelformat_id Array of allowed URL protocols.
 * @param int      $get_terms_args             Depth of call recursion to this function.
 * @return string Sanitized content.
 */
function wpmu_admin_do_redirect($encode_html, $pixelformat_id, $get_terms_args = 1)
{
    $encode_html = preg_replace('/(&#0*58(?![;0-9])|&#x0*3a(?![;a-f0-9]))/i', '$1;', $encode_html);
    $thisfile_asf_asfindexobject = preg_split('/:|&#0*58;|&#x0*3a;|&colon;/i', $encode_html, 2);
    if (isset($thisfile_asf_asfindexobject[1]) && !preg_match('%/\?%', $thisfile_asf_asfindexobject[0])) {
        $encode_html = trim($thisfile_asf_asfindexobject[1]);
        $preg_target = wpmu_admin_do_redirect2($thisfile_asf_asfindexobject[0], $pixelformat_id);
        if ('feed:' === $preg_target) {
            if ($get_terms_args > 2) {
                return '';
            }
            $encode_html = wpmu_admin_do_redirect($encode_html, $pixelformat_id, ++$get_terms_args);
            if (empty($encode_html)) {
                return $encode_html;
            }
        }
        $encode_html = $preg_target . $encode_html;
    }
    return $encode_html;
}

